  false,\n\t\"url\": null,\n\t\"notes\": \"Work on the Bayou Sauvage National Wildlife
  Refuge Master Plan and Environmental Impact Statement (EIS) was initiated in November
  1992 and scheduled for completion in December 1994. The Master Plan contains concepts
  to guide further development and implementation of land use and management programs
  and associated facilities and management structures. The EIS is being prepared in
  compiance with the National Environmental Protection Act (NEPA) guidelines. In addition
  to documenting the existing natural environmental and socio-economic setting, the
  EIS evaluates the impact of the proposed and alternative master plan actions and
  no action in order to facilitate selection of t he plan most suitable for implementation.\",\n\t\"license_title\":
